	focusSlider() {
		clearTimeout(this.timeout);
	}

	isOpen(status: boolean) {
		this.opened = status;
		// this.closeTemplate = status;
		if (status) {
			this.timeoutManage();
		} else {
			clearTimeout(this.timeout);
		}
	}

	leaveSlider() {
		if (this.opened) {
			clearTimeout(this.timeout);
			this.timeoutManage();
		}
	}

	timeoutManage() {
		this.closeTemplate = false;
		this.timeout = setTimeout(() => {
			this.closeTemplate = true;
		}, 3000);
	}

